@mlundblad I'm glad to confirm that from `appstream` v1.0.4, releases that are of type `snapshot` can omit the `date` attribute.

So we should be able to revert 27bb4c258a96a85a747e671f98b290c5d6c199e6 (that downgraded the lint severity for `release-time-missing`) in combination with adding `type="snapshot"` to the relevant [versionless-release entry](https://gitlab.gnome.org/GNOME/gnome-maps/-/blob/cda93e1e2bbfcffabb802d3096e816b988573df9/data/org.gnome.Maps.appdata.xml.in.in#L34) in the appdata XML file.

I'll plan to open a merge request for that soon, although I guess it may take a while before v1.0.4 becomes available in CI.

